/*==============================================================================

FUNCTION TMD22QVGA_BOOT_SPLASH_SCREEN

DESCRIPTION
  This function will send an image to the primary LCD, without using
  any REX dependencies (tramp, timers, etc). 
  It is meant to be called:
    1) At boot time to put a "splash screen" on the LCD before the
       phone has completely booted.
    2) From within ERR_FATAL where we cannot depend on REX to
       be operating normally.

DEPENDENCY
  Requires display to be already initialized
  
==============================================================================*/
void  disp_epson_S1D19120_chg_fail_splash_screen (void)
{
#if 0//def FEATURE_BOOT_SPLASH_SCREEN
    disp_update(charging_failed_data, 130, 0, 0, 34, 130, 130, 56);
#endif
}


/*==============================================================================

FUNCTION TMD22QVGA_BOOT_SPLASH_SCREEN

DESCRIPTION
  This function will send an image to the primary LCD, without using
  any REX dependencies (tramp, timers, etc). 
  It is meant to be called:
    1) At boot time to put a "splash screen" on the LCD before the
       phone has completely booted.
    2) From within ERR_FATAL where we cannot depend on REX to
       be operating normally.

DEPENDENCY
  Requires display to be already initialized
  
==============================================================================*/
void disp_epson_S1D19120_boot_chg_splash_screen (void)
{
#ifdef FEATURE_BOOT_SPLASH_SCREEN
#if defined(FEATURE_DISP_160X128)

#ifdef FEATURE_VERSION_HITZ181
	disp_update(phone_charging_data, 160, 0, 0, 128, 160, 0, 0);
#else
	disp_update(phone_charging_data, 80, 0, 0, 80, 80, 24, 40);
#endif

#elif defined(FEATURE_DISP_128X160)
	disp_update(phone_charging_data, 80, 0, 0, 80, 80, 40, 24);
#elif defined(FEATURE_DISP_128X128)
#if defined(FEATURE_VERSION_H19C)
    disp_update(phone_charging_data, 128, 0, 0, 128, 128, 0, 0);
#else
	disp_update(phone_charging_data, 80, 0, 0, 80, 80, 24, 24);
#endif
#elif defined(FEATURE_DISP_220X176)
	disp_update(phone_charging_data, 80, 0, 0, 80, 80, 48, 70);
#elif defined(FEATURE_DISP_176X220)
	disp_update(phone_charging_data, 80, 0, 0, 80, 80, 70, 48);
#elif defined(FEATURE_DISP_320X240)
	disp_update(phone_charging_data, 80, 0, 0, 80, 80, 80, 130);
#elif defined(FEATURE_DISP_240X320)
	disp_update(phone_charging_data, 80, 0, 0, 80, 80, 130, 80);
#endif  
#endif
}
